import './App.css';

class App extends Component {
  render() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hi Yihua
        </p>
        <button>Change Name</button>
      </header>
    </div>
  );
}
}

export default App;
